import React from "react";

const Korpa = ({ cartItems }) => {
    return (
      <div>
        <h2>Artikli u korpi:</h2>
        <ul>
          {cartItems.map((artikal, index) => (
            <li key={index}>{artikal.naziv}</li>
          ))}
        </ul>
      </div>
    );
  };

export default Korpa;
